    [],nt"revision_timestamp": "2015-05-07T01:22:47.754146",nt"name": "advanced-green-micropropulsion-system-project",nt"isopen":
    true,nt"url": null,nt"notes": "Systima in collaboration with University
    of Washington is developing a high performance injection system for advanced green
    monopropellant AF-M315E micropropulsion systems (0.1 &amp;#150; 1.0 N) for small-
    and micro-satellites and cubesats (100 kg-500 kg and &lt;100 kg).  The monopropellant
    has low-toxicity making it easy to store, integrate into modular designs and launch
    without added costs associated with handling toxic propellants such as hydrazine.
     The injector is a critical component that is designed to enhance combustion and
    optimize microthruster performance.  In the Phase I program, Systima and UW completed
    proof-of-concept tests that demonstrated the injector technical concept and system
    advantages.  In the Phase II program we will develop a prototype injector design,
    conduct injector performance testing and workhorse microthruster hot-fire tests
    with AF-M315E.  This effort will result in a monopropellant injection system for
    modular microthruster system designs that meets the needs of current and future
    small- and micro-satellites for NASA missions, commercial and military customers.",nt"license_title":
